Adam and Eve - Blackmarket Bayou (DvdRip)

Bree Olson, Ashli Orion, Jay Lassiter, Mackenzee Pierce, Marco Banderas, Nick Manning, Otto Bauer, Otto Bauer, Phoenix Marie, Randy Spears, Riley Evans, Sascha

Bree Olson is the ultimate bootlegger! In the not-too-distant future, gas shortages spawn an illegal new fuel that not only power your car, it jump-starts your libido! As corporate bigwigs battle swamp pirates over the invention, Bree and her sultry southern belles use their cunning and coozes to transport their liquid gold over state lines! See for yourself why it's better in the bayou!

Tags: Sex, Feature, xXx

